goog.provide("goog.net.iframeIoDifferentBaseTest");goog.setTestOnly("goog.net.iframeIoDifferentBaseTest");goog.require("goog.Promise");goog.require("goog.events");goog.require("goog.net.EventType");goog.require("goog.net.IframeIo");goog.require("goog.testing.TestCase");goog.require("goog.testing.jsunit");function setUpPage(){goog.testing.TestCase.getActiveTestCase().promiseTimeout=1e4}function testDifferentBaseUri(){var io=new goog.net.IframeIo;return new goog.Promise(function(resolve,reject){goog.events.listen(io,goog.net.EventType.COMPLETE,resolve);io.send("net/iframeio_different_base_test.txt")}).then(function(){assertNotEquals("File should have expected content.",-1,io.getResponseText().indexOf("just a file"))})}